#include <stdio.h>
#include <stdlib.h>
#include <math.h>

#define MAX(a,b) (a)>(b)?(a):(b)


typedef struct _tag_List
{
	int start;
	int end;
	int numNeg;
	int  firstNeg;
	int lastNeg;
	struct _tag_List *next;
}List;
List * lstHead = 0;
void lstAdd(int start, int end, int numNeg, int  firstNeg, int lastNeg)
{
	List *node = (List*)calloc(1, sizeof(List));
	node->start = start;
	node->end = end;
	node->numNeg = numNeg;
	node->firstNeg = firstNeg;
	node->lastNeg = lastNeg;
	if (lstHead == 0) lstHead = node;
	else
	{
		List *p = lstHead;
		while (p->next)
		{
			p = p->next;
		}
		p->next = node;
	}
}
void lstDestroy()
{
	List *p = lstHead;
	List *q;
	while (p)
	{
		q = p;
		p = p->next;
		free(q);
	}
	lstHead = 0;
}

int getPro(int* nums, int start, int end)
{
	int i = 0;
	int ret = 1;
	for (i = start; i <= end; i++)
	{
		ret *= nums[i];
	}
	return ret;
}
int maxProduct(int* nums, int numsSize) {
	long long curPro = 1;
	int maxPro = (1 << (sizeof(int) * 8 - 1));
	int i, j;
#if 0
	for (i = 0; i < numsSize; i++)
	{
		curPro = 1;
		for (j = i; j < numsSize; j++)
		{
		curPro *= nums[j];
		if (curPro>maxPro) maxPro = curPro;
		if (!curPro) break;
		}
	}
#else 
	{
		List *p = lstHead;
		int cnt = 0, start = -1, end = -1, firstNeg = -1, lastNeg = -1;
		for (i = 0; i < numsSize; i++)
		{
			if (start == -1)
			{
				if (i == 0 && nums[i]) start = 0;
				else if (!nums[i - 1] && nums[i])
				{
					start = i;
				}
			}
			if (start>-1 && end == -1)
			{
				if (nums[i] < 0)
				{
					cnt++;
					if (cnt == 1) firstNeg = i;
					lastNeg = i;
				}
				if ((i < numsSize - 1 && !nums[i + 1]) ||
					(i == numsSize - 1 && nums[i]))
				{
					end = i;
					lstAdd(start, end, cnt, firstNeg, lastNeg);
					start = -1;
					end = -1;
					cnt = 0;
				}
			}
			if (!nums[i]) maxPro = 0;

		}

		if (lstHead == 0)
		{
			maxPro = getPro(nums, 0, numsSize-1);
		}
		else
		{
			p = lstHead;

			while (p)
			{
				if ((p->numNeg % 2) && (p->lastNeg>p->start || p->end>p->firstNeg))
				{
					if (p->lastNeg - p->firstNeg > 2)
					{
						int tmpPro = getPro(nums, p->firstNeg + 1, p->lastNeg - 1);
						if (p->firstNeg >= p->start)
							maxPro = MAX(maxPro, getPro(nums, p->start, p->firstNeg)*tmpPro);
						if (p->end >= p->lastNeg)
							maxPro = MAX(maxPro, getPro(nums, p->lastNeg, p->end)*tmpPro);
					}
					else
					{
						if (p->lastNeg>p->start)
							maxPro = MAX(maxPro, getPro(nums, p->start, p->lastNeg - 1));
						if (p->end>p->firstNeg)
							maxPro = MAX(maxPro, getPro(nums, p->firstNeg + 1, p->end));
					}

				}
				else
				{
					maxPro = MAX(maxPro, getPro(nums, p->start, p->end));
				}
				p = p->next;
			}
		}


	}
	lstDestroy();
#endif
	return maxPro;
}
